import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { useOrder } from '../context/OrderContext';
import BackButton from '../components/BackButton';
import Toast from '../components/Toast';

const OrderStation = () => {
  const [formData, setFormData] = useState({
    passengerName: '',
    phone: '',
    trainNumber: '',
    pickupStation: '',
    coachNumber: '',
    seatNumber: ''
  });
  const [toast, setToast] = useState(null);
  const { saveOrderType, saveBookingDetails } = useOrder();
  const navigate = useNavigate();

  const stations = [
    'Dhaka',
    'Chittagong',
    'Sylhet',
    'Rajshahi',
    'Khulna',
    'Comilla',
    'Rangpur'
  ];

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    if (!formData.passengerName || !formData.phone || !formData.trainNumber || 
        !formData.pickupStation || !formData.coachNumber || !formData.seatNumber) {
      setToast({ message: 'Please fill in all fields', type: 'error' });
      return;
    }

    saveOrderType('station');
    saveBookingDetails({
      ...formData,
      orderType: 'station'
    });

    setToast({ message: 'Details saved! Redirecting to menu...', type: 'success' });
    setTimeout(() => {
      navigate('/menu-categories');
    }, 1000);
  };

  return (
    <div className="booking-page">
      <BackButton />
      <div className="container">
        <div className="booking-container">
          <div className="booking-header">
            <div className="booking-header-icon">üè¢</div>
            <div className="booking-header-text">
              <h2>Order At Station</h2>
              <p>Please provide your pickup station and train details</p>
            </div>
          </div>

          <div className="booking-form">
            <form onSubmit={handleSubmit}>
              <div className="form-group">
                <label>Passenger Name</label>
                <input
                  type="text"
                  name="passengerName"
                  value={formData.passengerName}
                  onChange={handleChange}
                  placeholder="Rashid Mostafa"
                  required
                />
              </div>

              <div className="form-group">
                <label>Phone Number</label>
                <input
                  type="tel"
                  name="phone"
                  value={formData.phone}
                  onChange={handleChange}
                  placeholder="01898942731"
                  required
                />
              </div>

              <div className="form-group">
                <label>Train Number</label>
                <input
                  type="text"
                  name="trainNumber"
                  value={formData.trainNumber}
                  onChange={handleChange}
                  placeholder="e.g., 701, 709, 711"
                  required
                />
              </div>

              <div className="form-group">
                <label>Pickup Station</label>
                <select
                  name="pickupStation"
                  value={formData.pickupStation}
                  onChange={handleChange}
                  required
                >
                  <option value="">Select Station</option>
                  {stations.map(station => (
                    <option key={station} value={station}>{station}</option>
                  ))}
                </select>
              </div>

              <div className="form-row">
                <div className="form-group">
                  <label>Coach Number</label>
                  <input
                    type="text"
                    name="coachNumber"
                    value={formData.coachNumber}
                    onChange={handleChange}
                    placeholder="e.g., KA, SHA"
                    required
                  />
                </div>

                <div className="form-group">
                  <label>Seat Number</label>
                  <input
                    type="text"
                    name="seatNumber"
                    value={formData.seatNumber}
                    onChange={handleChange}
                    placeholder="e.g., 25"
                    required
                  />
                </div>
              </div>

              <button type="submit" className="btn btn-primary btn-block btn-large">
                Continue to Menu
              </button>
            </form>
          </div>
        </div>
      </div>

      {toast && <Toast message={toast.message} type={toast.type} onClose={() => setToast(null)} />}
    </div>
  );
};

export default OrderStation;
